script: |
  super -f text -I q3201.spq | sort > q3201.out

inputs:
  - name: q3201.spq
    data: |
      SELECT DISTINCT + cor1.col1 AS col0 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1, tab0 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q3201.out
    data: |
      10
      13
      26
